window.bookSummaryJSON = "<p><b>Storm</b></p> <p>I hate myself more than she could ever hate me.</p> <p>The day I betrayed the love of my life was the day I lived up to every messed-up thing my mother predicted.</p> <p>But I'm tired of being broken. I'm tired of life not being worth living.</p> <p>I never thought I'd get a chance to make amends, but here I am, ready to earn my woman's love back.</p> <p>My road to recovery is ugly, and my road to redemption will be hard, but there is no Storm without his Keira.</p> <p>It's time I prove that to her.</p> <p><i>Storm</i> is a standalone in A Dark &amp; Dirty Sinners' MC Series.</p>"; 
